import React, { Component } from 'react';
import './Resume.css';

class Resume extends Component {



  render() {
      var goGators = {color: 'RoyalBlue'};
      var tiny = {fontSize: "12px"};

      var courses_formatted = this.props.relevant_courses.map(function(course){
        return <li>{course.title} <b>{course.lang}</b></li>;
      })

      var exp_formatted = this.props.experience.map(function(exp){
        return <li>{exp.title} <b>{exp.desc}</b></li>;
      })
      var involve_formatted = this.props.involvement.map(function(volv){
        return <li>{volv.title} <b>{volv.desc}</b></li>;
      })
      var projects_formatted = this.props.projects.map(function(project){
        return <li>{project.title} <b>{project.lang}</b></li>;
      })
      var tech_formatted = this.props.technology.map(function(tec){
        return <li>{tec.name} <i style={tiny}> {tec.lvl}</i> </li>;
      })


    return (
      <div className="res-wrapper">
        <div className="res-block">
            <h1>Resume</h1>

            {/* EDUCATION */}
            <h3>Education</h3>
            {this.props.year} Year Computer Science Student <span style = {tiny}>with a minor in {this.props.minor}</span> at the <span style={goGators}> University of Florida</span>


            {/* COURSEWORK */}
            <h3>Relevant Coursework</h3>
            <ul>
                {courses_formatted}
            </ul>


            {/* EXPERIENCE  */}
            <h3>Experience</h3>
            <ul>
                {exp_formatted}
            </ul>


            {/* INVOLVEMENT  */}
            <h3>Involvement</h3>
            <ul>
               {involve_formatted}

            </ul>

            {/* PROJECTS  */}
            <h3>Projects</h3>
            <ul>
              {projects_formatted} 
            </ul>

            {/* TECHNOLOGIES  */}
            <h3>Technologies</h3>
            <ul>
              {tech_formatted} 
            </ul>
        </div>


      </div>
    );
  }


}



 export default Resume;
